const Nav = () => {
  return (
    <div>
      <Link href='/'>
        <a className='home'>Home</a>
      </Link>
      <Link href='/about'>
        <a className='about'>About</a>
      </Link>
      <style jsx>{`
        .home {
          color: red
        }
      `}</style>
    </div>
  );
}

export default Nav;
